(function() {
  var StaticRouter;

  StaticRouter = (function() {
    function StaticRouter() {}

    StaticRouter.route = function(query, callback) {
      query.graph.debug('StaticRouter>', {
        data: query.current_router.configuration
      });
      query.data = query.current_router.configuration;
      return callback(query);
    };

    return StaticRouter;

  })();

  module.exports = StaticRouter;

}).call(this);
